import './App.css';
import axios from 'axios';

function registrazione() {

  axios({
    method: 'post',
    url: '/registrazione',
    data: {
      firstName: 'Finn',
      lastName: 'Williams'
    }
  });
  
    return (
      <h1>Registrazione</h1>
    );
  }
  
  export default registrazione;
